import styled from "styled-components";

const topp =styled.div`
    width: 100px;
    height: 30px;
    background-color: black;
    margin: 20px;
  padding: 10px;
  display: inline-block;
`;






const Top = (props) => {
    return (
        <>
            <topp></topp>
        </>
    );
};

export default Top;
